    true,nt"url": null,nt"notes": "<p>Office of Child Support Enforecment (OCSE)
    Story Behind the Numbers - Child Support Fact Sheet #3.  This fact sheet focuses
    on data reported in a recent U.S. Census Bureau report, Custodial Mothers and Fathers
    and Their Child Support: 2011. The data reported are estimated based on a biennial
    survey of custodial parents, the Child Support Supplement to the Current Population
    Survey, March/April 2012, co-sponsored by the Office of Child Support Enforcement.
     The proportion of custodial parents living below poverty line continues to increase
    in 2011. The report found that 4.2 million custodial parents lived in poverty in
    2011, representing 29 percent of all custodial parents, about twice the poverty
    rate for the total population. These statistics reinforce the essential role that
    child support services can play in helping low-income families, especially during
    an economic downturn.</p>n",nt"license_title": "Other License Specified",nt"extras":
